package dictionaries

import "encoding/hex"

type Dicts struct {
	Receipts []byte
}

// Fast - list of dictionaries which target high-sped instead of high-compression-ratio
var Fast = &Dicts{
	// cbor-encoded receipts
	// 5K blocks from [8_000_000:10980440], by logic: BlockN+=(to-from)/5_000
	// 32Kb
	// 10M blocks processing overhead: encode 3min, decode 1min
	Receipts: mustDecode(""),
}

func mustDecode(input string) []byte {
	dec, err := hex.DecodeString(input)
	if err != nil {
		panic(err)
	}
	return dec
}
